import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ borderWidth: 1 , height: 300, clear: "both", paddingTop: 120, textAlign: "center", alignContent: "center" }}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
